import { Color, Engine, Loader } from "excalibur";
import RootScene from "./scenes/root/scene";
import Lobby from "./scenes/lobby";

export default class Game extends Engine {
  constructor() {
    super({ width: 1024, height: 768, backgroundColor: Color.fromHex('#ccffff') });
    this.add('root', new RootScene());
    this.add('lobby', new Lobby());
  }

  async initialize() {
    const loader = new Loader([
    ]);
    loader.suppressPlayButton = true;
    loader.backgroundColor = '#ccffff';
    loader.logoHeight = 150;
    loader.logo = 'data:image/png;base64, ';
    await this.start(loader);
  }

  private static _instance?: Game;

  static async instance(): Promise<Game> {
    if (!this._instance) {
      this._instance = new Game();
      await this._instance.initialize();
    }
    return this._instance;
  }

  static get raw(): Game {
    if (!this._instance) {
      this._instance = new Game();
      this._instance.initialize();
    }
    return this._instance;
  }
}
